	-- Clear Weather override for Ashava fight
	Hydra.ClearWeatherOverride("Kehj_Hell")
	
	Hydra.ActorFadeAndDelete(BOSS, 2);
end

unk_9c63f9d.value:
Hydra.ActorDisable(Hydra.ActorsLinkedByActorInGroup(idSelf, "Trigger")[1]);

-- Clear Weather override for Ashava fight
Hydra.WeatherOverride("Kehj_Hell", "weather_Hell_Exterior_physical_FarObserver")

Hydra.BossEncounterManuallyQueueStart(BOSS_LEVEL_AREA);

local tHoradrim = Hydra.ActorsInGroup("QST_Hell_Battlefield_Ashava_Horadrim");

if (#tHoradrim > 0) then
	for i, idHoradrim in ipairs(tHoradrim) do
		Hydra.ActorAddAITarget(BOSS, idHoradrim, true);
		Hydra.ActorOverrideAIAwarenessRadius(idHoradrim, 100, false);
		Hydra.ActorOverrideAIAwarenessRadius(idHoradrim, 100, true);
		Hydra.ActorAIForcePrimaryTarget(idHoradrim, BOSS);
	
		Hydra.ActorFaceActor(idHoradrim, BOSS, true);
	end
end

