function Start(sEventName, idActor, nUserParam)
	Hydra.ActorEnable(BOSS)
	Hydra.ActorTriggerPowerAtFeet(BOSS, SPAWN_POWER);
	Hydra.MusicOverride("Kehj_Hell", "Music_WorldBoss_Ashava_Spawn");
end

function Start(idActorPlayer, sLevelAreaName)

	if (Hydra.ActorIsAlive(idActorPlayer)) then
		Hydra.ActorEnable(Hydra.ActorsLinkedByActorInGroup(idSelf, "Trigger")[1]);
	end
end

function Start(idActor, idActorDetector)
	-- Play boss start music
	Hydra.MusicOverride("Kehj_Hell", "Music_WorldBoss_TreasureBeast_Phase1");
	
	-- Horadrim move to a new location near wall where Ashava spawns
	Hydra.QActorMoveToLocationDynamicSpeed(NEYRELLE, Loc_Neyrelle_After_Horde, "NPC_Run", true)
	Hydra.QActorMoveToLocationDynamicSpeed(LORATH, Loc_Lorath_After_Horde, "NPC_Run", true)
	Hydra.QActorMoveToLocationDynamicSpeed(DONAN, Loc_Donan_After_Horde, "NPC_Run", true)
		
	Hydra.ActorEnable(BOSS)

	Hydra.ActorAddAITarget(BOSS, NEYRELLE, true);
	Hydra.ActorAIForcePrimaryTarget(NEYRELLE, BOSS);
	Hydra.ActorOverrideAIAwarenessRadius(NEYRELLE, 100, false);
	Hydra.ActorOverrideAIAwarenessRadius(NEYRELLE, 100, true);
	
	
	Hydra.ActorAddAITarget(BOSS, LORATH, true);
	Hydra.ActorAIForcePrimaryTarget(LORATH, BOSS);
	Hydra.ActorOverrideAIAwarenessRadius(LORATH, 100, false);
	Hydra.ActorOverrideAIAwarenessRadius(LORATH, 100, true);
	
	
	Hydra.ActorAddAITarget(BOSS, DONAN, true);
	Hydra.ActorAIForcePrimaryTarget(DONAN, BOSS);
	Hydra.ActorOverrideAIAwarenessRadius(DONAN, 100, false);
	Hydra.ActorOverrideAIAwarenessRadius(DONAN, 100, true);
	
	
	Hydra.ActorAddAITarget(BOSS, idActor, true);
end

function Start()
	Hydra.ActorWarpToActor(DONAN, Hydra.ActorsLinkedByActorInGroup(idSelf, "DONAN_RESET_LOC")[1], 0);
	Hydra.ActorWarpToActor(LORATH, Hydra.ActorsLinkedByActorInGroup(idSelf, "LORATH_RESET_LOC")[1], 0);
	Hydra.ActorWarpToActor(NEYRELLE, Hydra.ActorsLinkedByActorInGroup(idSelf, "NEYRELLE_RESET_LOC")[1], 0);
end
